import React, {useState} from 'react';
import birthdayData from './data/basic_data';
import birthdayList from './components/list';
import { Container, Card, CardContent, Typography, CardHeader, Box } from "@mui/material";
import useStyles from './styles/CardStyle';
import './App.css';

function App() {

  const [people, setPeople] = useState(birthdayData);
  const classes = useStyles();

  return (
    <Container sx={classes.mainContainer} maxWidth="xl" maxHeight="xl">
      <Box sx={{bgcolor: '#cfe8fc', height: '95vh', width: '95vw' }}>
        <h3>{people.length} Birthdays Today</h3>
        <birthdayList people={people} />
        <button onClick={() => setPeople([])}>clear all</button>
      </Box>
    </Container>
